import React, { Component } from "react"; 
import {Link} from 'react-router-dom'; 

export default class Nav extends Component {
    render(){
        return (
            <div> 
                <Link to= '/'> HOME </Link>
                <Link to= '/create'> CREATE RECIPE</Link>
            </div>
            )
    }

}
